public boolean equals(Object o) {
  if (this == o) {
    return true;
  }
  if (o == null || getClass() != o.getClass()) {
    return false;
  }
  if (!super.equals(o)) {
    return false;
  }
  PrivateToken<?> that = (PrivateToken<?>) o;
  return publicService.equals(that.publicService);
}
